import { Link } from 'react-router-dom';
import './AsideMenu.css'
import { ReactComponent as HomeIcon } from '../icons/home_icon.svg';
import { ReactComponent as CompassIcon } from '../icons/compas_icon.svg';


function AsideMenu() {

  return (
    <div className="AsideMenu">
      <ul>
        <li><Link to="/posts"><HomeIcon className="icon"/> Главная</Link></li>
        <li><Link><HomeIcon className="icon"/>Новости</Link></li>
        <li><Link><HomeIcon className="icon"/>Статьи</Link></li>
        <li><Link><CompassIcon className="icon"/>Обзоры</Link></li>
      </ul>
    </div>
  );
}
export default AsideMenu;
